import { useEffect, useMemo, useState } from 'react'
import { sessionsList, sessionsDelete } from '../../services/api'
import { IconSearch, IconRefresh, IconClear } from '../../components/Icons'
import Breadcrumbs from '../../components/Breadcrumbs'

export default function Sessions() {
  const [items,setItems] = useState([])
  const [total,setTotal] = useState(0)
  const [err,setErr] = useState('')
  const [q, setQ] = useState('')
  const [status, setStatus] = useState('All')
  const [page, setPage] = useState(1)
  const [deleting, setDeleting] = useState(null)
  const pageSize = 10

  const load = async (opts={}) => {
    try {
      setErr('')
      const { items, total } = await sessionsList({
        q, 
        status: status === 'All' ? '' : status,
        page, 
        pageSize, 
        ...opts
      })
      setItems(items)
      setTotal(total)
    } catch (e) { setErr(e.message) }
  }

  useEffect(()=>{ load() // initial
    // eslint-disable-next-line react-hooks/exhaustive-deps
  },[])

  useEffect(()=>{ load() // reload when page changes
    // eslint-disable-next-line react-hooks/exhaustive-deps
  },[page])

  const clearFilters = () => { 
    setQ(''); 
    setStatus('All'); 
    setPage(1); 
    load({ page: 1 }) 
  }

  const totalPages = Math.max(1, Math.ceil(total / pageSize))

  const formatDur = (sec) => {
    const m = Math.floor(sec/60), s = sec%60
    if (m > 0) return `${m}m ${s}s`
    return `${s}s`
  }

  const handleDelete = async (sessionId) => {
    if (!window.confirm('Are you sure you want to delete this session? This action cannot be undone.')) {
      return;
    }

    try {
      setDeleting(sessionId);
      await sessionsDelete(sessionId);
      // Reload the sessions after successful deletion
      load();
    } catch (error) {
      setErr(error.message || 'Failed to delete session');
    } finally {
      setDeleting(null);
    }
  }

  return (
    <div>
      <Breadcrumbs items={[{label:'Admin Panel', to:'/admin'}, {label:'Sessions'}]} />
      <div className="page-header"><h2>Session Management</h2></div>
      {err && <p className="error">{err}</p>}

      <div className="card">
        <div className="row" style={{ display: 'flex', gap: 8, alignItems: 'center', flexWrap: 'wrap' }}>
          <div style={{ flex: 1, minWidth: 240, display: 'flex', alignItems: 'center', gap: 8 }}>
            <IconSearch />
            <input 
              placeholder="Search by username or email" 
              value={q} 
              onChange={e => setQ(e.target.value)} 
              onKeyPress={e => e.key === 'Enter' && load()}
              style={{ flex: 1 }}
            />
          </div>
          <div style={{ display: 'flex', gap: 8, alignItems: 'center' }}>
            <select 
              value={status} 
              onChange={e => setStatus(e.target.value)}
              style={{ minWidth: 120 }}
            >
              <option value="All">All Status</option>
              <option value="Active">Active</option>
              <option value="Logged Out">Logged Out</option>
            </select>
            <button 
              className="btn" 
              onClick={() => { setPage(1); load({ page: 1 }) }}
            >
              Search
            </button>
            <button 
              className="btn ghost" 
              onClick={clearFilters}
              disabled={!q && status === 'All'}
            >
              <IconRefresh /> Reset
            </button>
          </div>
        </div>

        <div className="table-wrap">
          <table className="table">
            <thead>
              <tr>
                <th>Username</th>
                <th>Email</th>
                <th>Login Time</th>
                <th>Logout Time</th>
                <th>Duration</th>
                <th>Status</th>
                <th>Actions</th>
              </tr>
            </thead>
            <tbody>
              {items.map(s => (
                <tr key={s._id}>
                  <td>{s.username}</td>
                  <td>{s.email}</td>
                  <td>{new Date(s.loginAt).toLocaleString()}</td>
                  <td>{s.logoutAt ? new Date(s.logoutAt).toLocaleString() : '-'}</td>
                  <td>{formatDur(s.durationSec||0)}</td>
                  <td>
                    <span className={`chip ${s.status === 'Active' ? 'chip-success' : 'chip-muted'}`}>
                      {s.status}
                    </span>
                  </td>
                  <td>
                    <button 
                      className="btn-icon danger" 
                      onClick={() => handleDelete(s._id)}
                      disabled={deleting === s._id}
                      title="Delete session"
                    >
                      <IconClear />
                      {deleting === s._id ? 'Deleting...' : ''}
                    </button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>

        <div className="pagination">
          <button className="btn ghost" onClick={()=>setPage(p=>Math.max(1,p-1))}>Prev</button>
          <span className="hint">Page {page} of {totalPages}</span>
          <button className="btn ghost" onClick={()=>setPage(p=>Math.min(totalPages,p+1))}>Next</button>
        </div>
      </div>
    </div>
  )
}
